$(document).ready(function(){$.getJSON("json/insure.json",function(e){$.each(e,function(){if("content"in document.createElement("template"))for(var t=document.querySelector("#js-insurance__row"),n=t.content.querySelector(".company__name"),o=t.content.querySelector(".table__covering"),r=t.content.querySelector(".js-type"),c=t.content.querySelector(".js-level"),l=t.content.querySelector(".table__drugs"),a=t.content.querySelector(".table__visits"),u=t.content.querySelector(".table__deductible"),i=t.content.querySelector(".js-price"),_=e.cart,s=document.querySelector(".main__table"),y=0;y<_.length;y++){n.textContent=_[y].name,o.textContent=_[y].covering,r.textContent=_[y].type,c.textContent=_[y].level,l.textContent=_[y].drugs,a.textContent=_[y].visits,u.textContent=_[y].deductible,i.textContent=_[y].price;var d=document.importNode(t.content,!0);s.appendChild(d)}for(var m=$(".company__logo"),v=$(".table__level--color"),S=$(".company__rating").children(".star"),y=0;y<_.length;y++){m[y].setAttribute("src",_[y].logo),v[y].setAttribute("data-color",_[y].level.toLowerCase());for(var p=0;p<5;p++)if(p<_[y].rating){var g=5*y+p;S[g].setAttribute("data-color","gold")}}})})});